To use the package, use the following document class: \documentclass[preview]{standalone} and import the stellar package: \usepackage{stellar} The command \title needs to be inserted within the document. The commands \section, \subsection, and \subsubsection can be used normally as their behavior is overwritten by the package. Available commands: - \id - \genpage - \plain You can reference another snippet using: \snippetref[snippet-identifier][Some text]. To include a snippet: \includesnpt{snippet-identifier}
\includesnpt[param1=value1|param2=value2]{snippet-identifier} Create snippets using environments: \begin{snippet}{snippet-identifier} % snippet content
\end{snippet} Other types of snippets: \begin{snippetdefinition}{snippet-definition1}{Definition 1} % snippet content
\end{snippetdefinition} \begin{snippettheorem}{snippet-theorem1}{Theorem 1} % snippet content
\end{snippettheorem} \begin{snippetproof}{snippet-proof1}{snippet-theorem1}{Proof 1} % snippet content
\end{snippetproof}

