You can Configure User Snippets on VS Code (not to be confused with stellar snippets) in order to access some macro for the stellar.sty LaTeX package. The snippets file is available here . The file provides some autocompletions such as sdocument which will provide a basic template \documentclass[preview]{standalone} \usepackage{amsmath}
\usepackage{amssymb}
\usepackage{stellar}
\usepackage{definitions} \begin{document} \id{id}
\genpage \end{document} and also various macros to define snippets such as snippet \begin{snippet}{id} body
\end{snippet} sdefinition \begin{snippetdefinition}{id-definition}{name} body
\end{snippetdefinition} sproof, stheorem and such.

